import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import {Map,Marker,Popup,TileLayer}from "react-leaflet";
import {Icon, tileLayer} from "leaflet";
import "./map.css";
//maps components
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import useSwr from "swr";


import styles from "assets/jss/material-kit-react/views/landingPage.js";


const dashboardRoutes = [];

const useStyles = makeStyles(styles);

const fetcher = (...args) => fetch(...args).then(Response => Response.json);



export default function LandingPage(props) {
  const classes = useStyles();
  const { ...rest } = props;
  const datos ="https://jsonplaceholder.typicode.com/users";
  const {data,error} = useSwr(datos,{fetcher} ); 
  const notaria = data && !error ? data:[];
  return (
    <div>
      <div>
      <Header
        absolute
        color="white"
        brand="Arma Tu Fiesta"
        rightLinks={<HeaderLinks />}
        {...rest}
      />
      </div>
      <div className={classNames(classes.main, classes.main)}>
        <div className={classes.container}>
        <Map center={[10.48801,-66.87919]} zoom={8}>
        
        <TileLayer
          attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        {notaria.map(user => (
          <Marker>
            key={1}
            position={[10.48801,-66.87919]}
          </Marker>



        )
          
          
          
          
          )}
        </Map>
        </div>
      </div>
      <Footer />
    </div>
  );
}
